(19472, '8.0.1 [MHI] Conditionals - IGC', '------------------------------------------------------------\n--Copied from IGC Framework Candidates - Conditionals\n\n-- Alliance\nraceHuman 			= scene:EvalPlayerCondition( 47454 )	\nraceDwarf  			= scene:EvalPlayerCondition( 34465 )\nraceNightelf  		= scene:EvalPlayerCondition( 47458 )\nraceGnome  			= scene:EvalPlayerCondition( 33812 )\nraceDraenei  		= scene:EvalPlayerCondition( 34463 ) \nraceWorgen	 		= scene:EvalPlayerCondition( 47456 ) \n\n--------------------------------------------------------\n-- Horde\nraceOrc 			= scene:EvalPlayerCondition( 34464 ) \nraceUndead 			= scene:EvalPlayerCondition( 47453 )\nraceTauren	 		= scene:EvalPlayerCondition( 34467 ) \nraceTroll	 		= scene:EvalPlayerCondition( 34462 ) \nraceBloodelf 		= scene:EvalPlayerCondition( 47452 ) \nraceGoblin 			= scene:EvalPlayerCondition( 34466 )\n\n\n--------------------------------------------------------\n-- Allied Races\nraceLightforged 	= scene:EvalPlayerCondition( 54202 )\nraceVoidelf 		= scene:EvalPlayerCondition( 54203 )\nraceDarkIron 		= scene:EvalPlayerCondition( 61660 )\nraceHighmountain 	= scene:EvalPlayerCondition( 54204 )\nraceNightborne 		= scene:EvalPlayerCondition( 54205 )\nraceMaghar 			= scene:EvalPlayerCondition( 61661 )\nraceKultiran		= scene:EvalPlayerCondition( 66693 )\nraceZandalari		= scene:EvalPlayerCondition( 64968 )\nraceVulpera 		= scene:EvalPlayerCondition( 74393 )\n\n--------------------------------------------------------\n-- Neutral\nracePandaren 		= scene:EvalPlayerCondition( 34468 )\n\n\n\n\n------------------------------------------------------------\n\nfunction GetPlayerScale ()\n	PlayerScale = 1.5\n	PlayerAnim = Animations.Ready1H\n	\n	if 	raceDraenei then\n		\n		PlayerScale = 1.2;\n\n	elseif 	raceLightforged then\n		\n		PlayerScale = 1.2;\n\n	elseif racePandaren and genderMale then\n		PlayerScale = 1.35;\n		PlayerAnim = 860; -- sha ready spell cast\n\n	elseif racePandaren and genderFemale then\n		PlayerScale = 1.35;\n		PlayerAnim = 860; -- sha ready spell cast\n	\n\n	elseif raceGnome then\n	\n		PlayerScale = 2.3;\n		PlayerAnim = Animations.ReadyUnarmed;\n		\n		\n	elseif raceGoblin then\n	\n		PlayerScale = 2.1;\n				\n		\n	elseif raceTauren then\n		PlayerScale = 1;\n\n	elseif raceOrc then\n		PlayerScale = 1.35;\n		\n	elseif raceNightborne then\n		PlayerScale = 1.35;\n		\n	elseif raceTroll then\n		PlayerScale = 1.3;\n		\n	elseif raceVulpera then\n		PlayerScale = 2.3;\n		\n	elseif raceZandalari then\n		PlayerScale = 1.15;\n\n	elseif raceKultiran then\n		PlayerScale = 1.15;		\n	\n	elseif raceDwarf and genderMale then\n\n		PlayerAnim = Animations.ReadyFist1H;\n		PlayerScale = 1.75;\n	\n\n	elseif raceDwarf and genderFemale then\n		PlayerScale = 1.75;\n\n	elseif raceNightelf and genderMale then\n		PlayerAnim = 940; -- dru ready spell cast\n		PlayerScale = 1.2;\n\n	elseif raceNightelf and genderFemale then\n		PlayerAnim = 940; -- dru ready spell cast\n		PlayerScale = 1.2;\n\n	elseif raceWorgen and genderFemale then\n		PlayerScale = 1.25;\n		PlayerAnim = Animations.ReadyThrown;\n\n	elseif raceWorgen and genderMale then\n\n		PlayerScale = 1.25;\n		PlayerAnim = 860; -- sha ready spell cast\n\n\n\n				\n	end\n\nend\n\n------------------------------------------------------------\nGetPlayerScale ()\n', 34601),
(18141, '8.0.1 [MHI] SceneData - IGC', '\n-- Timing for each shot, converted into seconds. \n-- Enter the frame count.\n\nShotLength = {\n	[010] = framesToSeconds( 147 ) ;\n	[020] = framesToSeconds( 120 ) ;\n	[030] = framesToSeconds( 150 ) ;\n	[040] = framesToSeconds( 150 ) ;\n	[050] = framesToSeconds( 390 ) ;\n	}\n\n\n-----------------------------------------------------------------------------------\n\n-- Camera path IDs from the Path Tool.\n\nCamEye = {\n	[010] = 26783 ;		\n	[020] = 26786 ;\n	[030] = 26789 ;\n	[040] = 26802 ;\n	[050] = 26817 ;\n	}\n\n\nCamTarget = {\n	[010] = 26784 ;		\n	[020] = 26787 ;\n	[030] = 26791 ;\n	[040] = 26803 ;\n	[050] = 26818 ;\n	}\n\n\n-----------------------------------------------------------------------------------\n\nSendTrigger(\"SceneDataLoaded\")', 34601),
(19365, '8.0.1 [MHI] HeartOfAzeroth - IGC', '	WaitForTrigger(\"SetupLoaded\") \n	\n	\n	--HeartOfAzeroth\n\n\n	--Actor.HeartOfAzeroth:Fade(0,0)\n	--Actor.HeartOfAzeroth:Fade(1,.5)\n	\n	-- Create Attachment Data\n	local att = AttachmentData:Default()\n		att.parentActor = Actor.Player;\n		att.parentAttachment = AttachmentPoint.HandLeft;\n		att.childAttachment  = AttachmentPoint.Base;\n		att.useChildAttachOrientation = true;\n		att.useTargetOffset = true;\n		att.targetOffset = Transform:New( Vector:New(.01, -.1, -.1), -25 ,120, -90 );\n		att.transitionTime = .4;\n	\n\n	--Actor.HeartOfAzeroth:IGC_MoveToPathStart( Data.HeartOfAzeroth.pathData[010] )\n	--Actor.HeartOfAzeroth:IGC_FacingPath(Data.HeartOfAzeroth.pathData[010], 1, 2)\n	\n-- SHOT 010 -----------------------------------------------------------------------------------------\n\n	WaitForTrigger(\"StartShot010\") Wait(0)\n	\n	Actor.HeartOfAzeroth:SetAttachedTo( att )\n	\n	\n\n-- SHOT 050 -----------------------------------------------------------------------------------------\n\n	WaitForTrigger(\"StartShot050\") Wait(0)\n	\n	\n	Wait(6)\n	\n	Actor.HeartOfAzeroth:Fade(1,.5)\n	\n	\n	Actor.HeartOfAzeroth:IGC_PlayAnim ( Animations.CustomSpell02, 0, 0.75, true, 0, 1000) ', 34601),
(24189, '[7] Timeline Properties - RTC v0.1', 'oneShotAnimKitID=19291, loopingAnimKitID=19292, boneSetID=AnimKitBoneSets.UpperBody},\n	{ boneName=\"FullBody\",		oneShotAnimKitID=19284, loopingAnimKitID=19285, boneSetID=AnimKitBoneSets.FullBody},\n}\n\nfor priority,animationData in ipairs(animationTable) do\n	local name = \"Animation_\" .. animationData.boneName\n	SceneTimelineAddStatePropertyEvent(name,\n	{\n		eventFields = \n		{\n			{\n				name = \"animID\",\n				type = TimelineDataType.Record,\n				default = -1,\n				meta = \n				{\n					table = \"AnimationData\",\n				}\n			},\n\n			{\n				name = \"variation\",\n				type = TimelineDataType.Integer,\n				default = 0,\n			},\n\n			{\n				name = \"looping\",\n				type = TimelineDataType.Boolean,\n				default = false,\n				meta = \n				{\n					isLooping = true,\n				}\n			},\n\n			{\n				name = \"speed\",\n				type = TimelineDataType.Float,\n				default = 1.0,\n				meta = \n				{\n					playbackRate = true,\n				}\n			},\n\n			{\n				name = \"blendIn\",\n				type = TimelineDataType.Float,\n				default = 0.15,\n			},\n		},\n\n		GetUniqueID = function(key)\n			if (key.eventFields.looping) then\n				return \"loop-\" .. animationData.boneName .. \"-\" .. tostring(key.eventFields.animID)\n			else\n				return \"oneshot-\" .. animationData.boneName .. \"-\" .. tostring(key.eventFields.animID)\n			end\n		end,\n\n		ApplyState = function(property, actor, key, time)\n			if (not actor.timelineAnimationKitInstances) then\n				actor.timelineAnimationKitInstances = { }\n			end\n			local id = property.GetUniqueID(key)\n\n			local playData = AnimKitData:Default()\n			if (key.eventFields.looping) then\n				playData.animKitID = animationData.loopingAnimKitID\n			else\n				playData.animKitID = animationData.oneShotAnimKitID\n			end\n\n			playData.isMaintained = true\n			playData.animOverride = key.eventFields.animID\n			playData.boneSetIDOverride = animationData.boneSetID\n			playData.variationOverride = key.eventFields.variation\n\n			playData.startTimeOverrideMS = (time - key.time) * 1000 --milliseconds\n\n			if (key.eventFields.speed ~= 1.0) then\n				playData.speedOverrideType = AnimKitSpeedType.Set\n				playData.speedOverrideValue = key.eventFields.speed\n			end\n\n			playData.blendOverrideType = AnimKitBlendType.Set\n			playData.blendOverrideMS = key.eventFields.blendIn * 1000 --milliseconds\n\n			actor.timelineAnimationKitInstances[id] = actor:PlayAnimKitEx(playData)\n		end,\n	\n		RemoveState = function(property, actor, key, time)\n			if (not actor.timelineAnimationKitInstances) then\n				return\n			end\n			local id = property.GetUniqueID(key)\n			local instance = actor.timelineAnimationKitInstances[id]\n			if (instance) then\n				actor.timelineAnimationKitInstances[id] = nil\n				instance:Stop()\n			end\n		end,\n	})\nend\n', 34601),
(24369, '8.3 [MRE] Conditionals - IGC', '------------------------------------------------------------\n\nscene:AddFadeRegion(Vector:New(4022.36, 1908.85, 358.84), 60.0, true)\n\nscene:RemoveFadeRegionExcludedCreature(110152)\nscene:RemoveFadeRegionExcludedCreature(110153)\nscene:RemoveFadeRegionExcludedCreature(110154)\nscene:RemoveFadeRegionExcludedCreature(110155)\nscene:RemoveFadeRegionExcludedCreature(110156)\nscene:RemoveFadeRegionExcludedCreature(110157)\n\nscene:RemoveFadeRegionExcludedGameObject(1346340)\nscene:RemoveFadeRegionExcludedGameObject(1346341)\nscene:RemoveFadeRegionExcludedGameObject(1346342)\nscene:RemoveFadeRegionExcludedGameObject(1346343)\nscene:RemoveFadeRegionExcludedGameObject(1346344)\nscene:RemoveFadeRegionExcludedGameObject(1346345)\n\n------------------------------------------------------------\n\ncamCamPos = nil\n\n------------------------------------------------------------\n\n--Alliance\nplayerHuM	=	scene:EvalPlayerCondition(34987)\nplayerHuF	=	scene:EvalPlayerCondition(34988)\nplayerDwM	=	scene:EvalPlayerCondition(34991) --Includes Dark Iron\nplayerDwF	=	scene:EvalPlayerCondition(34992) --Includes Dark Iron\nplayerNiM	=	scene:EvalPlayerCondition(34993) --Includes Nightborne\nplayerNiF	=	scene:EvalPlayerCondition(34994) --Includes Nightborne\nplayerGnM	=	scene:EvalPlayerCondition(34999)\nplayerGnF	=	scene:EvalPlayerCondition(35000)\nplayerDrM	=	scene:EvalPlayerCondition(35007) --Includes Lightforged\nplayerDrF	=	scene:EvalPlayerCondition(35008) --Includes Lightforged\nplayerWoM	=	scene:EvalPlayerCondition(44885) --Worgen Transformed\nplayerWoF	=	scene:EvalPlayerCondition(44886) --Worgen Transformed\nplayerGiM	=	scene:EvalPlayerCondition(44884) --Gilnean\nplayerGiF	=	scene:EvalPlayerCondition(44887) --Gilnean\nplayerKtM	=	scene:EvalPlayerCondition(67699)\nplayerKtF	=	scene:EvalPlayerCondition(67700)\nplayerMeM	=	scene:EvalPlayerCondition(76806)\nplayerMeF	=	scene:EvalPlayerCondition(76808)\n\n--Horde\nplayerOrM	=	scene:EvalPlayerCondition(34989) --Includes Mag\'har\nplayerOrF	=	scene:EvalPlayerCondition(34990) --Includes Mag\'har\nplayerScM	=	scene:EvalPlayerCondition(34995)\nplayerScF	=	scene:EvalPlayerCondition(34996)\nplayerTaM	=	scene:EvalPlayerCondition(64341) --Includes Highmountain\nplayerTaF	=	scene:EvalPlayerCondition(64342) --Includes Highmountain\nplayerTrM	=	scene:EvalPlayerCondition(35001)\nplayerTrF	=	scene:EvalPlayerCondition(35002)\nplayerBeM	=	scene:EvalPlayerCondition(35005) --Includes Void Elf\nplayerBeF	=	scene:EvalPlayerCondition(35006) --Includes Void Elf\nplayerGoM	=	scene:EvalPlayerCondition(35003)\nplayerGoF	=	scene:EvalPlayerCondition(35004)\nplayerZaM	=	scene:EvalPlayerCondition(68507)\nplayerZaF	=	scene:EvalPlayerCondition(68508)\nplayerVuM	=	scene:EvalPlayerCondition(76804)\nplayerVuF	=	scene:EvalPlayerCondition(76805)\n\n--Pandaren\nplayerPaM	=	scene:EvalPlayerCondition(35012)\nplayerPaF	=	scene:EvalPlayerCondition(35013)\n\n------------------------------------------------------------\n\nfunction playerCheck()\n	if 		(playerTaM) or --Super tall folks\n			(playerZaM) or\n			(playerZaF) or\n			(playerTaF) then\n		camCamPos = [[8.3 [MRE] Magni Reconnects the Engine - IGC\\8.3 [MRE] 1030\\CamEye_1030_ExtraTall]]\n	elseif 	(playerDrM) or --Tall\n			(playerDrF) or\n			(playerKtM) or\n			(playerKtF) or\n			(playerNiM) or\n			(playerNiF) or\n			(playerTrM) or\n			(playerTrF) or\n			(playerWoM) or\n			(playerWoF) or \n			(playerPaM) then \n		camCamPos = [[8.3 [MRE] Magni Reconnects the Engine - IGC\\8.3 [MRE] 1030\\CamEye_1030_Tallbois]]\n	elseif 	(playerGnM) or --Itty Bitty\n			(playerGnF) or \n			(playerGoM) or \n			(playerGoF) or\n			(playerMeM) or\n			(playerMeF) or\n			(playerVuM) or\n			(playerVuF) then\n		camCamPos = [[8.3 [MRE] Magni Reconnects the Engine - IGC\\8.3 [MRE] 1030\\CamEye_1030_Shorties]]\n	else\n		camCamPos = [[8.3 [MRE] Magni Reconnects the Engine - IGC\\8.3 [MRE] 1030\\CamEye_1030]] --Normal\n		', 34601),
